import React from 'react'
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	Dimensions,
	TouchableHighlight,
} from "react-native";
import MyDrawer from './CustomDrawer';

const Dashboard = () => {
  return (
    <View>
        <TouchableHighlight
        onPress={()=>{
            // return(
            //     <MyDrawer/>

            // )
            <MyDrawer/>
        }}
        
        >
            
            <View >
                <Text style={{fontSize:46}}>Drawer</Text>
            </View>
        </TouchableHighlight>
    </View>
  )
}

export default Dashboard
